import React from 'react';
import Tour from './Tour';
import styles from "./Tour.module.css"
const Tours = ({ tours }) => {
  return (
    <section>
      <div className={styles.title}>
        <h2>our tours</h2>
        
      </div>
      <div>
        {tours.map((tour) => {
          return <Tour key={tour.id} {...tour} />;
        })}
      </div>
    </section>
  );
};

export default Tours;
